import { ErrorRequestHandler } from 'express'
import HttpException from '../errors/httpException'

const errorHandler: ErrorRequestHandler = (err, _req, res, _next) => {
	console.log(err)
	if (err instanceof HttpException) {
		return res.status(err.status).json({message: err.message, stack: err.stack})
	}
	return res.status(500).json({ message: 'Something went wrong, please try again' })
}

export default errorHandler

export default class HttpException extends Error {
	public status: number
	public message: string
	constructor(status: number, message: string) {
		super(message)
		this.status = status
		this.message = message
	}
}

import { RequestHandler } from 'express'
import HttpException from '../errors/httpException'

const notFound: RequestHandler = (_req, _res, next) => {
	const err = new HttpException(404, 'Endpoint not found')
	next(err)
}

export default notFound

import { RequestHandler } from 'express'
import HttpException  from '../errors/httpException'

export const isPalyndrome: RequestHandler = async (req, res, next) => {
	const { start, end } = req.body

	try {
		if (!start && !end) throw new HttpException(400, 'Both inputs must be provided')

		if (typeof start !== 'number' || typeof end !== 'number')
			throw new HttpException(400, 'Inputs must be numbers')

		if (!Number.isInteger(start) || !Number.isInteger(end))
			throw new HttpException(400, 'Inputs must be integers')

		if (start < 0 || end < 0 )
			throw new HttpException(400, 'Inputs must be positive numbers')

		if (start === end)
			throw new HttpException(400, 'Inputs must be a valid range')

		if (start > end)
			throw new HttpException(400, 'The first number must be less than the last')

		const result = []

		for (let i = start; i <= end; i++) {
			const numToString = String(i)
			const reversedNum = numToString.split('').reverse().join('')
			if (numToString == reversedNum) {
				result.push(i)
			}
		}
		return res.status(200).json(result)
	} catch (error) {
		next(error)
	}
}

import { RequestHandler } from 'express'
import HttpException  from '../errors/httpException'

export const changeChecker: RequestHandler = (req, res, next) => {
	const { purchaseValue, moneyHandedOver } = req.body

	try {
		if (!purchaseValue && !moneyHandedOver) throw new HttpException(400, 'Both inputs must be provided')

		if (typeof purchaseValue !== 'number' || typeof moneyHandedOver !== 'number')
			throw new HttpException(400, 'Inputs must be numbers')

		if (moneyHandedOver < purchaseValue) throw new HttpException(400, 'Money handed over value must be bigger than the purchase value')

		const fixedPurchase = purchaseValue.toFixed(2)
		const fixedMoneyHanded = moneyHandedOver.toFixed(2)
		const change = Number(fixedMoneyHanded) - Number(fixedPurchase)

		let bills100 = 0
		let bills10 = 0
		let bills1 = 0
		let cents = 0


		if(change >= 0) {
			let changeInReais = Math.floor(change)
			cents = (change - changeInReais) * 100

			if (changeInReais >= 100) {
				bills100 = Math.floor(change / 100)
				changeInReais %= 100
			}

			if (changeInReais >= 10) {
				bills10 = Math.floor(change / 10)
				changeInReais %= 10
			}

			bills1 = changeInReais
		}

		res.status(200).json({ bills1, bills10, bills100, purchaseValue: fixedPurchase, moneyHandedOver: fixedMoneyHanded, cents })

	} catch (error) {
		next(error)
	}
}

import { RequestHandler } from 'express'
import HttpException  from '../errors/httpException'
import Carro from '../../models/Carro'
import { join } from 'path'
import Moto from '../../models/Moto'
import { appendFile } from 'fs'
const vehicles: Carro[] & Moto[] = []


export const createVehicle: RequestHandler = async (req, res, next) => {
	const { type, model, year, doors, brand, passengers } = req.body

	try {
		if (type === 'CARRO') {
			if (doors !== 2 && doors !== 4) 
				throw new HttpException(400, 'Car must have 2 or 4 doors only')

			const car = new Carro(model, year, doors, brand)
			vehicles.push(car)
		}

		if(type == 'MOTO') {
			if (passengers !== 1 && passengers !== 2) 
				throw new HttpException(400, 'The number os passengers must be 1 or 2 only')

			const bike = new Moto(model, year, passengers, brand)
			vehicles.push(bike)
		}
		appendFile(join(__dirname, '../database', 'vehicles.json'), JSON.stringify(vehicles), (err) => {
			if (err) {
				console.log(err)
			} else {
				return res.sendStatus(201)
			}
		})
	} catch (error) {
		next(error)
	}
}

import Veiculo from '../interfaces/Veiculo'

class Carro implements Veiculo {
	modelo: string
	anoFabricacao: number
	quantidadePortas: number
	marca: string

	constructor (modelo: string, anoFabricacao: number, quantidadePortas: number, marca: string) {
		this.modelo = modelo
		this.anoFabricacao = anoFabricacao
		this.marca = marca
		if (quantidadePortas >= 2 && quantidadePortas <= 4) {
			this.quantidadePortas = quantidadePortas
		} else {
			throw new Error('A quantidade de portas deve estar entre 2 e 4.')
		}
	}
}

export default Carro

import Veiculo from '../interfaces/Veiculo'

class Moto implements Veiculo {
	modelo: string
	anoFabricacao: number
	rodas: number
	passageiros: number
	marca: string

	constructor (modelo: string, anoFabricacao: number, passageiros: number, marca: string) {
		this.modelo = modelo
		this.anoFabricacao = anoFabricacao
		this.rodas = 2
		this.marca = marca
		if (passageiros >= 1 && passageiros <= 2) {
			this.passageiros = passageiros
		} else {
			throw new Error('O número de passageiros deve estar entre 1 e 2.')
		}
	}
}

export default Moto

import { RequestHandler } from 'express'
import { getCepInfo } from '../network/CepApi'

export const getInfo: RequestHandler = async (req, res, next) => {
	const { cep } = req.query

	try {
		const data = await getCepInfo(cep as string)
		return res.status(200).json(data)
	} catch (error) {
		next(error)
	}
}

import HttpException  from '../errors/httpException'
import axios from 'axios'

export const getCepInfo = async (cep: string) => {
	try {
		if (cep.length !== 8) throw new HttpException(400, 'Invalid CEP')

		const res = await axios.get(`https://viacep.com.br/ws/${cep}/json/`)

		if (!res.data) throw new HttpException(500, 'Something has gone wrong, try again')

		if (res.status == 400) throw new HttpException(400, 'Invalid CEP')

		if (res.data.erro) throw new HttpException(400, 'CEP not found')

		return {
			zip: res.data.cep,
			address: res.data.logradouro,
			neighborhood: res.data.bairro,
			city: res.data.localidade,
			state: res.data.uf
		}
	} catch (error) {
		if (error instanceof Error) {
			throw new HttpException(400, error.message)
		}
	}
}
